// src/components/Doctordashboard.js
import React from 'react';
import { Link, Outlet } from 'react-router-dom';
import './Doctordashboard.css'; // Assuming you have a CSS file
function Doctordashboard() {
  return (
    <div className="dashboard-container">
      {/* Sidebar */}
      <div className="sidebar">
        <h2>Doctor Dashboard</h2>
        <button><Link to="profile">Create Profile</Link></button>
        <button><Link to="availability">Availability</Link></button>
        <button><Link to="appointments">View Appointments</Link></button>
      </div>

      {/* Main Content */}
      <div className="main-content">
        <Outlet /> {/* Renders the selected sub-component */}
      </div>
    </div>
  );
}

export default Doctordashboard;
